import React from 'react';
import { NavLink } from 'react-router-dom';


const Navigation = () => {
    return (

        <nav className="navigation container">
            <div className="brand">NK</div>

            <div> 
            <ul>
                <NavLink to='/' activeClassName='nav-active' >
                    <li>Home</li>
                </NavLink>

                <NavLink to='/about' activeClassName='nav-active' >
                    <li>About</li>
                </NavLink>

                <NavLink to='/skills' activeClassName='nav-active' >
                    <li>Skills</li>
                </NavLink>

                <NavLink to='/works' activeClassName='nav-active' >
                    <li>Works</li>
                </NavLink>

                <NavLink to='/contact' activeClassName='nav-active' >
                    <li>Contact</li>
                </NavLink>
            </ul>
            </div>  
        </nav>
    );
};

export default Navigation;
